-- Name: most_recent_stats(date); Type: FUNCTION; Schema: soccer; Owner: postgres
--

CREATE FUNCTION soccer.most_recent_stats(d date) RETURNS SETOF soccer.stats
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
        SELECT stats.*
        FROM stats
        JOIN (
            SELECT player, MAX(attribute_date) as attribute_date
            FROM soccer.stats
            WHERE attribute_date <= d
            GROUP BY player
        ) AS RS ON RS.player = stats.player AND RS.attribute_date = stats.attribute_date;
END;
$$;


